import { expect } from "chai";

export const checkNotNUllProductItems = (itemArray) => {
  for (let index = 0; index < itemArray.length; index++) {
    expect(itemArray[index].product_id).is.not.null;
    expect(itemArray[index].product_name).is.not.null;
    expect(itemArray[index].f_sale_price).is.not.null;
    expect(itemArray[index].f_loan_price).is.not.null;
    expect(itemArray[index].image).is.not.null;
  }
};

